import React from 'react';

import { DeleteOutlined, EditOutlined } from '@ant-design/icons';

import './index.css';

import { Table, Button } from 'antd';
function TabelaHortalicas() {
    const dataSource = [
        {
            cod: '1',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00'
        },
        {
            cod: '2',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00'
        },
        {
            cod: '3',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00'
        },
    ];

    const columns = [
        {
            title: 'Codigo',
            dataIndex: 'cod',

        },
        {
            title: 'Nome',
            dataIndex: 'nome',
        },
        {
            title: 'Categoria',
            dataIndex: 'categoria',
        },
        {
            title: 'Classificação',
            dataIndex: 'classificacao',

        },
        {
            title: 'Valor',
            dataIndex: 'valor',
        },

        {
            title: 'Ações',
            dataIndex: 'acoes',
            render: _ => (
                <span>

                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        icon={<EditOutlined />}
                    />
                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        danger
                        icon={<DeleteOutlined />}
                    />
                </span>
            ),
        },
    ];



    return (
        <Table dataSource={dataSource} columns={columns} className='Tabela' />
    );
}

export default TabelaHortalicas;
